B.Ku=A.a(s(["Am kollektorseitigen Ende (X=XB) ist wegen UBC<0 die Dichte n\xb4 sehr gering (~0), am emitterseitigen Rand (X=0) erreicht sie wegen UBE >0V sehr gro\xdfe Werte. Wegen der exponentiellen Abh\xe4ngigkeit reichen bereits kleine Spannungs\xe4nderungen UBE aus, um eine \xc4nderung der Dichte von n` am emitterseitigen Ende (X=0) der Basis zu erreichen. Die Steigung - und damit der Strom Ic durch den Transistor - h\xe4ngt damit unmittelbar von der Basis-Emitterspannung UBE ab, wobei bereits sehr kleine \xc4nderungen der Basis-Emitterspannung eine gro\xdfe \xc4nderung von Ic hervorrufen (Verst\xe4rkereffekt)."]),t.s)
